// import React, { useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import { useEffect, useState } from "react";
import DisplayProjects from "../DisplayProjects/index";
import Toolbar from "@mui/material/Toolbar";
import Nav from "../../../Nav"

export default function AllProjects() {
  const [data, setData] = useState([]);

  const { type } = useParams();

  useEffect(() => {
    axios.get(`http://localhost:5000/projects/${type}`).then((res) => {
      console.log(res);

      console.log(res.data.type);
      setData(res.data);
      console.log(data);
    });
  }, []);

  return (
    <>
      <Nav />
      <Toolbar id="back-to-top-anchor" />

      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr 1fr",
          gridRowGap: "50px",
          marginLeft: "150px",
          marginBottom: "100px",
          marginTop:"100px"
        }}
      >
        {data.map((elem) => {
          return (
            <DisplayProjects
              url={elem.img}
              leader={elem.leader}
              date={elem.date}
              name={elem.name}
              type={elem.type}
              desc={elem.desc}
              team={elem.teamNeeded}
              level={elem.level}
              location={elem.location}
            />
          );
        })}
      </div>
    </>
  );
}
